//Module import
import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Home from '../Home/Home';
import About from '../About/About';

//Styles import

import './App.css';

//App component
class App extends Component {
	constructor(props) {
		super(props);

		this.state = {};
	}
	render() {
		return (
			<Router>
				<p>Hello world</p>
				<Home></Home>
				<About></About>
			</Router>
		);
	}
}

export default App;
